Page({

  /**
   * 页面的初始数据
   */
  data: {
    avatarUrl: 'data:image/jpeg;base64,',
    back_url: 'data:image/svg+xml;base64,',
    userName: '李清荷',
    sexRange: ['男','女'],
    jobRange: ['本科生','硕士','博士'],
    index1: 0,
    index2: 0,
    company: '',
    flag: false
  },

  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
    
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function () {
    
  },

  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {
    
  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function () {
    
  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function () {
    
  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function () {
    
  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function () {
    
  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function () {
    
  },
  back: function () {
    wx.navigateBack({
      delta: 1
    })
  },
  sexChange: function(e){
    this.setData({
      index1: e.detail.value
    })
  },
  jobChange: function(e){
    this.setData({
      index2: e.detail.value
    })
  },
  companyChange: function(e){
    this.setData({
      company: e.detail.value
    })
  },
  checkInfo: function(){
    if(!this.data.company){
      wx.showToast({
        title: '请输入所属单位',
        icon: 'none'
      })
    }else{
      this.setData({
        flag: true
      })
    }
  },
  submitInfo: function(){
    if(!this.data.flag){
      wx.showToast({
        title: '请输入全部信息',
        icon: 'none'
      })
      return
    }
    wx.request({
      url: '',
      success: function(){
        wx.showToast({
          title: '保存成功',
          icon: 'none'
        })
      }
    })
  }
})